import React from "react";

const PersonRow = (props) => {
  return (
    <tr>
      <td><span className="dot circledot">OS</span></td>
      <td>
        {props.data.firstName} {props.data.lastName}
      </td>
      <td>
        {props.data.amount}
      </td>
      <td colSpan='2'>
        {props.data.narration}
      </td>
      <td>
        {props.data.transactionDate}
      </td>
    </tr>
  );
}

export default PersonRow;
